import React, { useEffect, useState } from "react";
import { Dropdown }  from 'react-bootstrap';
import Navbar from "../components/navbar";
import "./mypost.css";
const Mypost = () => {

  return (
    <div className="allpage">
      <Navbar />
      <h1>โพสต์ของฉัน</h1>
        <div className="container-mypost">
            <div className="cotainer-mypost2">
                <div className="profile-img">
                    <img className="img-circle" src="/profile.png" />
                    <div className="name">
                        @Nuitychibiko
                    </div><br/>
                    <div className="date">
                        13/11/2563 
                        <span className="time">23:38 </span>
                    </div>
                </div>
                <Dropdown>
                    <Dropdown className="settingpost">
                        <img className="img-setting" src="/setting.png" />
                    </Dropdown>

                    <Dropdown.Menu>
                        <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                        <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                        <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                    </Dropdown.Menu>
                </Dropdown>
                <div className="profile-bad-img">
                    <img className="img-circle" src="/profile.png" />
                </div>
            </div>
        </div>
    </div>
  );
};

export default Mypost;
